import React,{ useState, useEffect } from "react"
import axios from 'axios'

function Blog() {
    const [blog, setblog] = useState([])

    useEffect(() => {
        axios.get('http://127.0.0.1:5000/blog').
        then (res =>{
            // console.log(res.data)
            setblog(res.data)
        }).catch(error => console.log(error))

      }, [])


    return (
        blog.forEach(ele=>{
            <div>
                <h1>{ele['username']}</h1>
            </div>
        })

    )
}

export default Blog
